import React from "react";

const ExploreSection = () => {
  return (
    <div className="relative bg-gray-50 py-16">
      {/* Background Pattern */}
      <div className="absolute inset-0">
        <div className="w-full h-full bg-gradient-to-r from-red-200 to-red-50 bg-opacity-50 [mask-image:linear-gradient(to-bottom,black,transparent)]"></div>
      </div>

      {/* Content */}
      <div className="relative z-10 text-center">
        <h1 className="text-5xl font-bold text-gray-900">Explore</h1>
        <p className="mt-4 text-gray-600">
          Explore our AI agents which cut short your most of the business
          expenses
        </p>
      </div>
    </div>
  );
};

export default ExploreSection;
